import React, { Component } from 'react'
import {Row, Col, Icon, Button} from 'antd'

export default class ChatTextarea extends Component {
    render() {
        return (
            <div>
                <div className="chat-tools">
                    <Row>
                        <Col span={18}>
                            &nbsp;<Icon type="smile" /> &nbsp;&nbsp;
                            <Icon type="folder" />
                        </Col>
                        <Col span={6}>
                        </Col>
                    </Row>
                </div>
                <textarea className="chat-textarea" placeholder="输入信息..." />
                <Button style={{ float: "right" }}>Enter</Button>
            </div>
        )
    }
}
